import React, { useState } from 'react'
import './Resume.css'
import ScrollService from '../../utilities/ScrollService'
import ScreenHeading from '../../utilities/ScreenHeading/ScreenHeading'
import Animations from '../../utilities/Animations'

export default function Resume(props) {
    const [selectedBulletIndex, setSelectedBulletIndex] = useState(0)
    const [carsoselOffsetstyle, setCarsoselOffsetstyle] = useState({})

    const ResumeHeading = (props) =>{
        <div className="resume-heading">
            <div className="resume-main-heading">
                <div className="heading-bullet">
                    <span> { props.heading? props.heading : ''} </span>
                    {props.fromDate && props.toDate? (
                        <div className="headingDate">
                            {props.fromDate + "-"+ props.toDate}
                        </div>
                    )
                    :
                    <div/>
                    }
                </div>
                <div className="resume-sub-heading">
                    <span> {props.subHeading? props.subHeading : ''}</span>
                </div>
                <div className="resume-heading--description">
                    <span> {props.description? props.description : ''}</span>
                </div>
            </div>
        </div>
    }
    const resumeBullet = [
        {label: "Education", logoSrc:"education.svg"}, 
        {label: "Work History", logoSrc:"work-history.svg"}, 
        {label: "Programming Skills", logoSrc:"programming-skills.svg"}, 
        {label: "Projects", logoSrc:"projects.svg"}, 
        {label: "Interests", logoSrc:"interests.svg"}
    ]

    const programmingSkillsDetails = [
        {skill: 'Javascript', rating: 85},
        {skill: 'React Js', rating: 85},
        {skill: 'Vue Js', rating: 70},
        {skill: 'Python', rating: 95},
        {skill: 'Java', rating: 90},
        {skill: 'Node Js', rating: 88},
        {skill: 'C++', rating: 85},
        {skill: 'HTML', rating: 97},
        {skill: 'CSS', rating: 92},
        {skill: 'AWS', rating: 80},
    ]

    const projectDetails = [
        {
            title: 'Anthems — Website / Hackathon Project', 
            duration: {
                fromDate: "NOV 2020" , 
                toDate: "NOV 2020"
            },
            details: `
            · Placed best overall for designing a music blog highlights the best new music and upcoming artists in Hip Hop
            · Features included a music player using a cloud flare api, polaroid connecting to Spotify pages, and a blog discussing music
            · Utilized: Dynamic HTML, CSS, Javascript, Cloudflare API, Git, and Jquery
            `,
            link: "https://gwikina.github.io/Anthems/"
        },
        {
            title: 'HelloMyNameIs', 
            duration: {
                fromDate: "SEP 2021" , 
                toDate: "SEP 2021"
            },
            details: `
            · Generated random profiles for random people using the random user generator api
            · Created an algorithm to shuffle titles and eliminate duplicates
            · Utilized: React, Random-user-generator-api, CSS, Git
            `,
            link: "https://gwikina.github.io/HelloMyNameIs/"
        },
        {
            title: 'Grid World - Python & Reinforcement Learning', 
            duration: {
                fromDate: "MAR 2022" , 
                toDate: "MAR 2022"
            },
            details: `
            · Implemented Grid-world domain that we learned in class using the environmental dynamics to shape learning
            · Implemented the value iteration algorithm to find the optimal policy.
            · Accessed the data by tracking statistics
            · Utilized: Python3, NumPy, Reinforcement Learning, Gridworld, Object-oriented programming
            `,
            link: "https://github.com/gwikina/Gridworld.git"
        },
    ]

    const resumeDetails = [
        <div className="resume-screen-container" key="education">
            <ResumeHeading 
                heading = {"Rochester Institute of Technology"}
                subHeading = {"Bachelor of Science, Software Engineering"}
                fromDate = {'2019'}
                toDate= {"2023"}
            />
        </div>, 
        <div className="resume-screen-container" key="work-experience">
        <ResumeHeading 
            heading = {"American Express"}
            subHeading = {"Software Engineering Intern"}
            fromDate = {'JUN 2022'}
            toDate= {"AUG 2022"}
        />
    </div>

    ]


    let fadeInScreenHandler = (screen)  => {
        if(screen.fadeScreen !== props.id)
            return
        Animations.animations.fadeInScreen(props.id)
    }
    const fadeInSubscription = ScrollService.currentScreenFadeIn.subscribe(fadeInScreenHandler)
    return (
        <div className="resume-container screen-container" id={props.id || ""}>
            <div className="resume-content">
                <ScreenHeading title={'Resume'} subHeading={'Learn more about me'} />
            </div>
        </div>
    )
}
